import React from 'react';

class ImageCard extends React.Component {
    props = {
        image: {}
    }
    render() {
        return (
            <div className="image-list">
                <img alt={this.props.image.description} 
                src={this.props.image.url.regular}
            />
            </div>
        )
    }

};

export default ImageCard;
